Accounts_CustomFields_Description:
Skal være gyldigt JSON, hvor nøgler er feltnavne, der indeholder en ordbog med feltindstillinger. Eksempel:<br/><code>{
"role": {
"type": "select",
"defaultValue": "student",
"options": ["lærer", "studerende"],
"required": true,
"modifyRecordField": {
"array": true,
"felt": "roller"
}
},
"twitter": {
"type": "text",
"required": sandt,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Skal være et gyldigt JSON, hvor nøgler er sprog, der indeholder en ordbog med nøgle og oversættelser. Eksempel: <br/><code>{
"en": {
"Kanaler": "Værelser"
},
"pt": {
"Kanaler": "Salas"
}
}</code>
